  let navigate = useNavigate();

  const routeChange = () => {
    let path = '/chapter_2';
    navigate(path);
  }

  return (
    <div className="container">
      <h1>Chapter 1</h1>
      <div className="image-wrapper">
        <img src={ahbeng} className="ahbeng-img"/>
        <p>
          Xiao Ming, I need relationship advice. 
          I met this person online and I think I'm in love!
        </p>
      </div>
      
    </div>
  )
}
